import React from "react";
import styles from "./ListWrapper.module.css";

export const ListWrapper = (props) => {
  return (
    <>
      <div className={styles["item-wrap"]}>
        <div className={styles["item"]}>{props.children}</div>
      </div>
    </>
  );
};
